⁣⁣
⁣
📍Edam es una ciudad de Países Bajos que se encuentra al norte, pertenece a la comuna Edam-Volendam y está en una zona que es conocida a nivel turístico como Old Holland. ⁣
⁣
La cuidad fue fundada en el año 1357 cuando el Conde Guillermo V de Holanda le dio esa categoría.⁣
🚤 Por su ubicación y geografía fue siempre una ciudad portuaria. En el siglo XVI existían unos 33 muelles en Edam siendo así una de las más importantes en el norte de Holanda. ⁣
⁣
🚶🏻‍♂️Según información en internet en el año 2007 tenía una población de unos 7300 habitantes pero sumando el resto de la comuna (con Volendam) llegaba a casi 30000. ⁣
⁣
🏰 Esta separada en dos partes como la mayoría de las ciudades europeas teniendo un casco antiguo que se encuentra muy bien conservado y es muy fácil de recorrer a pie. Y por otro lado hay una ciudad más moderna, la cual no viste así que no puedo contarles mucho. ⁣
⁣
El idioma oficial es el neerlandes pero muchos hablas inglés y es fácil hacerse entender. ⁣
⁣
Espero que les guste esta pequeña ciudad de la que solo publique hace mucho una foto, justamente esta pero editada de otra forma...⁣
Los próximos 5 días les voy a ir contando algunas cosas más! ⁣
⁣
⁣
🔶 ¿Conocían? ¿La escucharon nombrar alguna vez? El nombre seguro les es familiar... ¿se dan cuenta porque?⁣
⁣
